Content:
Headers - Any static headers that should be used in the API call should be included here.

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/[BASE ID]/[TABLE NAME]/",
    "method":"GET",
    "headers":{
        "Content-Type": "application/json"
        }
}
```

# Basic Authentication type 'basic' - Basic authentication takes user name and password for the API and returns a header.

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/[BASE ID]/[TABLE NAME]/",
    "method":"GET",
    "authentication":{
        "type":"basic",
        "auth_parameters": {
            "username": "USERNAME",
            "password":"PASSWORD"
            }            
        }
}
```

**API Token** - API token method takes **three** parameters. One specifies the `key` name, one to specify the `value` for that key and last one to specify if this should be sent as query parameters or as query header by defining the `target` property (takes `header` or `param`).

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/[BASE ID]/[TABLE NAME]/",
    "method":"GET",
    "authentication":{
        "type":"api_key",
        "auth_parameters": {
            "target": "header",
            "key": "api_key_header_name",
            "value":"your_api_key"
            }            
        }
}
```

**Bearer Token** - Bearer token takes a `dictionary` which contains the login url, the token location (in the successful request) and the body that needs to be send to the login endpoint to generate a valid `access_token`.

**Example:**

```json
{
    "uri": "https://myexampleapi.com/v0/mybase/exampletable/",
    "method": "GET",
    "authentication":{
        "type": "bearer",
        "auth_parameters": {
            "token_url": "https://myexampleapi.com/api/login",
            "token_location": "['access_token']",
            "token_body":{
                "grant_type": "access_token",
                "client_id": "client_id",
                "client_secret": "client_secret"
                }
            }            
        }
}
```

The above example will perform a `POST` call to the `https://myexampleapi.com/api/login` with the `token_body` as the body content of the call.

_Please note, the response should generate a property names `access_token` at the root level. This will be expanded in the future release to support dynamic properties and token expiration timeout call._

parameters - This option allows allows the capability to add one or many query parameter for the final call.

_Please only only only this when you are not passing any query parameters directly in the `uri` and `uri` only contains the endpoint address._

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/[BASE ID]/[TABLE NAME]",
    "method":"GET",
    "parameters":{
        "parameter1":"yes",
        "parameter2":"no"        
        }
}
```

The above will produce the following output

```none
https://myexampleapi.com/v0/[BASE ID]/[TABLE NAME]?parameter1=yes&parameter2=no
```

When a parameter values need to be dynamic or forms part of a loop, then just need to wrap the value name in `{ANY_NAME}`.

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/mybase/mytable",    
    "method":"GET",
    "parameters":{
        "record": "{recordid}",
        "limit": 1        
        },
    "authentication":{
        "type":"api_key",
        "auth_parameters": {
            "target": "header",
            "key": "api_key_header_name",
            "value":"your_api_key"
            }            
        },
    "loop":{
        "loop_type":"url",
        "filters": {            
            "level_1": [{
                "type": "url_parameter",
                "name": "recordid",
                "values": ["record_1", "record_2", "record_3"]
                }]
            }
        }
}
```

Above will result in `three` urls to be used in loop -

```json
[
    "https://myexampleapi.com/v0/mybase/mytable/?record=record_1&limit=1",
    "https://myexampleapi.com/v0/mybase/mytable/?record=record_2&limit=1",
    "https://myexampleapi.com/v0/mybase/mytable/?record=record_3&limit=1"
]
```

Body - Body property accepts valid `json` payload. Currently this only support static payload which gets forwarded to the API.

**Example:**

```json
{
    "uri": "https://myexampleapi.com/",
    "body": {
        "id": "someid",
        "key": "somekey",
        "some_object": {"some_object":"some_value"}
    },
    "authentication": {
        "type": "none"
    },
    "pagination": {
        "pagination_type": "none"
    }
}
```

Loop type `url_parameter` - For example, for `https://myexampleapi.com/api/v1/{baseid}/{tableid)` where first loop through all the `baseid` and then for each `baseid`, further loop is required to loop through the `tableid`. This is achieved using the example below -

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/{baseid}/mytable/{recordid}",    
    "method":"GET",
    "authentication":{
        "type":"api_key",
        "auth_parameters": {
            "target": "header",
            "key": "api_key_header_name",
            "value":"your_api_key"
            }            
        },
    "loop":{
        "loop_type":"url",
        "filters": {
            "level_1": [{
                "type": "url_parameter",
                "name": "baseid",
                "values": ["random_id"]
                }],
            "level_2": [{
                "type": "url_parameter",
                "name": "recordid",
                "values": ["record_1", "record_2", "record_3"]
                }]
            }
        }
}
```

if dealing with a single hierarchy loop, then just need to pass the `level_1` values.

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/mybase/mytable/{recordid}",    
    "method":"GET",
    "authentication":{
        "type":"api_key",
        "auth_parameters": {
            "target": "header",
            "key": "api_key_header_name",
            "value":"your_api_key"
            }            
        },
    "loop":{
        "loop_type":"url",
        "filters": {            
            "level_1": [{
                "type": "url_parameter",
                "name": "recordid",
                "values": ["record_1", "record_2", "record_3"]
                }]
            }
        }
}
```

if multiple values need to be changed per hierarchy level, then just extend the array with the additional properties.

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/mybase/{talbeid}/{recordid}",    
    "method":"GET",
    "authentication":{
        "type":"api_key",
        "auth_parameters": {
            "target": "header",
            "key": "api_key_header_name",
            "value":"your_api_key"
            }            
        },
    "loop":{
        "loop_type":"url",
        "filters": {            
            "level_1": [{
                "type": "url_parameter",
                "name": "recordid",
                "values": ["record_1", "record_2", "record_1"]
                },
                {
                "type": "url_parameter",
                "name": "tableid",
                "values": ["table_1", "table_1", "table_2"]
                }]
            }
        }
}
```

Loop type `date` - This option allows setting a single date value for the url. When using this option, an additional `date` property is required. For mat of the date and the is defined in `format` property and the dynamic date value is calculated from the `today` date based on `no_of_days` property.

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/data",    
    "method":"GET",
    "parameters":{
        "site": "somesite",
        "date":"{date}"
    },
    "authentication":{
        "type":"api_key",
        "auth_parameters": {
            "target": "header",
            "key": "api_key_header_name",
            "value":"your_api_key"
            }            
        },
    "loop":{
        "loop_type":"url",
        "filters":{                
            "level_1": [{
                "type": "date",            
                "date": {
                    "no_of_days": -1,
                    "format":"%Y-%m-%d"
                },
                "name": "date"
                }]
            }
        }
}
```

**Result:**

```url
https://myexampleapi.com/v0/data?site=somesite&date=2023-01-25
```

Above example to retrieves `yesterday` in the `yyyy-mm-dd` format where `today` is 2023-01-26.

for additional date formatting - please use this link - [Date formatting](https://strftime.org/)

Loop type `date_list` - This allows dynamic date values to be passed on for looping instead of static value. this take a `date_list` property where you can define how many dates to include in the array, the format of the date and whether it should contain the current day or not.

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/data",    
    "method":"GET",
    "parameters":{
        "site": "somesite",
        "date":"{date}"
    },
    "authentication":{
        "type":"api_key",
        "auth_parameters": {
            "target": "header",
            "key": "api_key_header_name",
            "value":"your_api_key"
            }            
        },
    "loop":{
        "loop_type":"url",
        "filters":{                
            "level_1": [{
                "type": "date_list",            
                "date_list": {
                    "no_of_days": 7,
                    "include_today": 0,
                    "format":"%Y-%m-%d"
                },
                "name": "date"
                }]
            }
        }
}
```

**Result:**

```url
https://myexampleapi.com/v0/data?site=somesite&date=2023-01-25
https://myexampleapi.com/v0/data?site=somesite&date=2023-01-24
https://myexampleapi.com/v0/data?site=somesite&date=2023-01-23
https://myexampleapi.com/v0/data?site=somesite&date=2023-01-22
https://myexampleapi.com/v0/data?site=somesite&date=2023-01-21
https://myexampleapi.com/v0/data?site=somesite&date=2023-01-20
https://myexampleapi.com/v0/data?site=somesite&date=2023-01-19
```

Above example to retrieves a date list containing last 7 dates not including `today` in the `yyyy-mm-dd` format where `today` is 2023-01-26.

for additional date formatting - please use this link - [Date formatting](https://strftime.org/)

Loop type `api_list` - This option allows fetching the loop values from another API call. `GET` or `POST` call in the same origin with static url is supported. No support for dynamic url for this (use `api_list_ext` for all dynamic properties). This option requires `uri` property, which indicates where the call should be made to retrieve the list for loop. This also requires `origin`, which indicates if that api endpoint is part of the same API or an external API. Currently support the value `same`, meaning only allowed to call an endpoint in the same API to generate the list. `name` property indicates the the value to be fetched from the API to generate the list, this `name` property also used in the top level url for loop.

**Example:**
We have our shop list at - `https://myexampleapi.com/api/v2/shops/`. We need to get the list of all shops first and then loop through individually to get details for each shops. `Shops` endpoint returns the following response -

```json
[{"shop_id": 10,"location":"manchester",............},
{"shop_id": 11,"location":"london",............},
{"shop_id": 12,"location":"chester",............}]
```

The following example shows how to fetch that data and create a list using `shop_id` and then loop through the values to get details for each shops.

_NOTE: this does not create `distinct` list values. If the API returns duplicate values, that will be passed in the loop array. For `distict` list, please use `api_list_ext`_

```json
{
    "uri": "https://myexampleapi.com/api/v2/site/shops/{shop_id}",
    "loop":{
        "loop_type":"url",
        "filters": {
            "level_1": [{
                "type": "api_list",
                "name": "shop_id",
                "origin": "same",
                "uri": "https://myexampleapi.com/api/v2/shops/",
                "method": "GET"
                }]                
            }
        },
    "pagination": {
        "pagination_type": "none"
    }
}
```

Loop type `api_list_ext` - This is more advanced option for fetching loop list value from various API. This allows calling of any API with its own loop, authentication and other dynamic properties. This requires a `query_params` property, which takes `json` object similar to the structure of this API with slight difference in the `authentication` parameter. Instead of passing full `authentication` property, this allows usage of the parent's `authentication` property with following set as the authentication type - `loop_same_origin`. `name` property indicates the the value to be fetched from the API result set to generate the list, this `name` property also used in the top level url for loop. This generates a list with `distinct` values.

**Example:**

```json
{
        "uri": "https://myexampleapi.com/api/shops/GetAllShops/{shopId}/{date}/{date}/{SessionID}",
        "headers": {
            "Content-Type": "application/json"
        },
        "method": "GET",
        "authentication": {
            "type": "basic_extended",
            "auth_parameters": {
                "token_method": "GET",
                "username": "USERNAME",
                "password": "PASSWORD",
                "token_url": "https://myexampleapi.com/api/Account/Login",
                "token_location": "['SessionID']",
                "custom_flow": "SOME_CUSTOM_FLOW"
            }
        },
        "loop": {
            "loop_type": "url",
            "filters": {
                "level_1": [{
                    "type": "api_list_ext",
                    "name": "shopId",
                    "query_params": {
                        "uri": "https://myexampleapi.com/api/sites/{dateloop}/{SessionID}",
                        "headers": {
                            "Content-Type": "application/json"
                        },
                        "method": "GET",
                        "authentication": {
                            "type": "loop_same_origin"
                        },
                        "loop": {
                            "loop_type": "url",
                            "filters": {
                                "level_1": [{
                                    "type": "date",
                                    "date": {
                                            "no_of_days": -1,
                                            "format": "%Y-%m-%d"
                                    },
                                    "name": "dateloop"
                                }]
                            }
                        }
                    }
                }],
                "level_2": [{
                    "type": "date",
                    "date": {
                        "no_of_days": -1,
                        "format": "%Y-%m-%d"
                    },
                    "name": "date"
                }]
            }
        }
    }
```

offset - This option takes `located_in` property, which indicates where the pagination `offset` property can be found in the result (in the response `header` or response `body` element). `append_to` indicates whether the offset value to be passed on as header key, value pair or as a query parameter. `key_value_pair` indicates the name of the `key` that should be used and value field indicates where the value of the `offset` can be found in the query result. `result_append_to` indicated where the paged result should be appended.

For example, a paged response like the one below -

```json
{
    "records": [
        {"id": "rec022TEGU87hwKva", "createdTime": "2023-01-27T09:04:51.000Z", "fields": {"Status": "Done", "Notes": "sdfsdf", "Assignee": "Kenny", "Name": "test"}},
        {"id": "rec0CnFP4qzfrto1P", "createdTime": "2023-01-27T09:05:05.000Z", "fields": {"Status": "Done", "Notes": "sdfsdf", "Assignee": "kab", "Name": "test2"}}
        {...},
        {...},
        {...}], 
    "offset": "itrrhaPGX3KVRIcGK/recdBC3RFNUwBrqAe"
}
```

the following setup can be used to retrieve the `offset` value and append to the `records` data set to present the entire data set as one.

```json
{
    "uri":"https://myexampleapi.com/v0/data",    
    "method":"GET",
    "parameters":{
        "site": "somesite",
        "date":"{date}"
    },
    "authentication":{
        "type":"api_key",
        "auth_parameters": {
            "target": "header",
            "key": "api_key_header_name",
            "value":"your_api_key"
            }            
        },
    "loop":{
        "loop_type":"url",
        "filters":{                
            "level_1": [{
                "type": "date_list",            
                "date_list": {
                    "no_of_days": 7,
                    "include_today": 0,
                    "format":"%Y-%m-%d"
                },
                "name": "date"
                }]
            }
        },
    "pagination": {
        "pagination_type": "offset",
        "offset": {
            "located_in": "body",
            "append_to": "params",
            "key_value_pair":{
                "offset":"['offset']"
            },               
            "result_append_to":"['records']"
            }
        }
}

```

JSON - When returning the result as `JSON`, just need to use the following example -

```json
{
    "uri":"https://myexampleapi.com/v0/data",    
    "method":"GET",
    "storage":{
        "storage_plan":"single",
        "storage_type": "full_json"
        }
}
```

`azure_blob` option allows saving of the query response to a azure blob storage. (Firewall storage is currently not supported). This takes `connection_string` and `container_name`, both of these can be found in Azure portal for a given storage. Addition to those two parameters, this also takes `file` property. `file` object holds information on the file naming convention to use. `use_loop` in `file` allows file name to use looping values used in the query loop.

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/data",    
    "method":"GET",
    "loop":{
        "loop_type":"url",
        "filters": {
            "level_1": [{
                "type": "url_parameter",
                "name": "site",
                "values": [999]
                }],
            "level_2": [{                    
                "type": "date_list",            
                "date_list": {
                    "no_of_days": 4,
                    "include_today": 0,
                    "format":"%Y-%m-%d"
                    },
                "name": "date"
                }]
            }
        },
    "storage":{
        "storage_plan":"loop",
        "storage_type": "azure_blob",            
        "azure_blob":{
            "connection_string":"CONNECTION STRING TO AZURE BLOB",
            "container_name":"NAME OF THE AZURE BLOB CONTAINER"
            },
        "file":{
            "use_loop": 1,
            "file_name": "{site}_data_{date}"
            }
        }
}
```

The above example creates dynamic file name for each query where the `{site}` and `{date}` is same as the query parameters for each api calls.

When `"use_loop": 0` is used, dynamic `date-time` can be added to the file name to maintain the unique file naming convention.

**Example:**

```json
{
    "uri":"https://myexampleapi.com/v0/data",    
    "method":"GET",
    "loop":{
        "loop_type":"url",
        "filters": {
            "level_1": [{
                "type": "url_parameter",
                "name": "site",
                "values": [999]
                }],
            "level_2": [{                    
                "type": "date_list",            
                "date_list": {
                    "no_of_days": 4,
                    "include_today": 0,
                    "format":"%Y-%m-%d"
                    },
                "name": "date"
                }]
            }
        },
    "storage":{
        "storage_plan":"single",
        "storage_type": "azure_blob",            
        "azure_blob":{
            "connection_string":"CONNECTION STRING TO AZURE BLOB",
            "container_name":"NAME OF THE AZURE BLOB CONTAINER"
            },
        "file":{
            "use_loop": 0,
            "file_name": "data_{today}",
            "format":"%Y-%m-%d"
            }
        }
}
```

The above example saves a single file using the `data_yyyy-mm-dd` format.
